import React, { Component,useState, useEffect } from "react";
import Navbar from './components/Navbar/Navbar';
import AOS from "aos";
import $ from 'jquery';
function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div className="App">
      <div className="menu fixed-top "></div>
      <Navbar></Navbar>
      </div>
  );
}

export default App;
